    return (
      <div>
      <Card 
        onClose={() => props.onClose(props.city.id)}
        city={props.city}
      />  
      </div>
    )
  } else {return (
    <div style={{color: 'white', fontSize: '20pt', textAlign: 'left', margin: '20px'}}>
      Error 404: ciudad no encontrada
    </div>  
  )}
}

export default City;
